import frame from '../static/images/Frame.png';
import image10 from '../static/images/image 10.png';
import { styled } from "@mui/material";
import { useState } from "react";
import eye from '../static/images/EyeSlashFill.png';

const Input = styled('input')({
    border: 'none',
    borderBottom: '2px solid black',
    marginBottom: '25px',
    fontSize: '22px',
});

const Button = styled('button')({
    marginTop: '20px',
    borderRadius: '5px',
    background: 'black',
    color: 'white',
    textAlign: 'center',
    fontSize: "25px",
    height: "50px",
    cursor: "grab"
})

export default function LoginSignUp() {
    const [acc, toggleAcc] = useState('login');

    const handlebuttonclick = () => {
        if (acc === 'login')
            toggleAcc('signup');
        else
            toggleAcc('login');
    }

    const handlechange = () => {
        let pass = document.getElementById('SignUpPassword');
        let cpass = document.getElementById('confirmPassword');
        console.log(pass.value, cpass.value);
        if (pass.value !== cpass.value) {
            document.getElementById('errormsg').style.display = 'block';
        }
        else {
            document.getElementById('errormsg').style.display = 'none';
        }
    }

    return (
        <div style={{ display: 'flex', justifyContent: "center" }}>
            <img src={image10} alt='10' />
            <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', position: 'relative', whiteSpace: 'nowrap' }}>
                <div style={{ position: 'absolute', top: '0', width: '100%', display: 'flex', alignItems: 'center' }}>
                    <img src={frame} alt='frame' style={{ width: '24px', height: '24px' }} />
                    <h4 style={{ marginLeft: '1%' }}>User Interface Enhancement for Access Database</h4>
                </div>
                {acc === 'login' ?
                    <div>
                        <h1>Welcome back</h1>
                        <p style={{ fontSize: '20px' }}>Welcome back! Please enter your details.</p>
                        <br />
                        <form style={{ display: 'flex', flexDirection: 'column' }}>
                            <Input type='email' name='Email' placeholder='Email' />
                            <Input type='password' name='Password' placeholder='Password' pattern="\w{8}" title="8 character password" />
                            <a href='#' style={{ alignSelf: 'end' }}>Forgot Password</a>
                            <Button>Log In</Button>
                        </form>
                        <p style={{textAlign:'center'}}> 
                            Don't have an account?
                        <button onClick={handlebuttonclick}
                            style={{ border: "none", background: 'none', fontSize: '15px', cursor: "grab" }}>
                            <u style={{ marginLeft: '1%' }}>
                                Signup
                            </u>
                        </button>
                        </p>
                    </div>
                    :
                    <div>
                        <h1>Welcome back</h1>
                        <p style={{ fontSize: '20px' }}>Welcome back! Please enter your details.</p>
                        <br />
                        <form style={{ display: 'flex', flexDirection: 'column' }}>
                            <Input type='text' name='username' placeholder='User Name' />
                            <Input type='email' name='Email' placeholder='Email' />
                            <div style={{ display: 'flex', marginBottom: '25px' }}>
                                <Input style={{ marginBottom: '0px', width: '100%' }} type='password' id='SignUpPassword' placeholder='Password' title="Password must be at least 8 characters, include one uppercase letter, one number, and one special character" required />
                                <img src={eye} style={{ width: "20px", height: "20px", borderBottom: '2px solid black', marginTop: '2.2%' }}></img>
                            </div>
                            <p style={{ display: 'none', margin: '0', color: 'red' }} id='errormsg' >Password's don't match</p>
                            <Input type='password' id='confirmPassword' placeholder='Confirm Password' required onChange={handlechange} />
                            <a href='#' style={{ alignSelf: 'end' }}>Forgot Password</a>
                            <Button>Log In</Button>
                        </form>
                        <p style={{textAlign:'center'}}> 
                            Have an account?
                        <button onClick={handlebuttonclick}
                            style={{ border: "none", background: 'none', fontSize: '15px', cursor: "grab" }}>
                            <u style={{ marginLeft: '1%' }}>
                                Signup
                            </u>
                        </button>
                        </p>
                    </div>
                }
            </div>

        </div>
    )
}
